import React from "react";
import { getRiskCategoryInfo } from "../../utils/helpers";

export default function PredictionResult({ prediction }) {
  if (!prediction) return null;
  const info = getRiskCategoryInfo(prediction.risk_category);
  return (
    <div className="p-4 rounded bg-gray-50 mt-4">
      <h3 className={`font-bold mb-2 text-${info.color}-700`}>
        Risk Category: {info.label}
      </h3>
      <p>Risk %: <span className={`font-semibold text-${info.color}-700`}>{prediction.risk_percentage}%</span></p>
      <p className="italic text-gray-600">{info.description}</p>
      <p className="text-[12px] text-gray-400 mt-2">Predicted at {new Date(prediction.predicted_at).toLocaleString()}</p>
    </div>
  );
}
